import { act } from "react-dom/test-utils";

const BOOKMARKTRUE = "bookmark/BOOKMARKTRUE";
const BOOKMARKFALSE = "bookmark/BOOKMARKFALSE";

export const bookmarkTrue = (id) => ({
  type: BOOKMARKTRUE,
  id: id,
});

export const bookmarkFalse = (id) => ({
  type: BOOKMARKTRUE,
  id: id,
});

const intialID = {
  trueID: [],
};

function bookmarkChange(state = intialID, action) {
  switch (action.type) {
    case BOOKMARKTRUE:
    case BOOKMARKFALSE:
    default:
      return state;
  }
}
